import React from 'react';
import Expense from "./components/Expenses/Expense";

function App() {
  let expense = [
    {
      id: "1",
      date: new Date(2023, 6, 24),
      Title: "School Fee",
      Amount: 300,
    },
    {
      id: "2",
      date: new Date(2023, 6, 24),
      Title: "School Fee2",
      Amount: 785,
    },
    {
      id: "3",
      date: new Date(2023, 6, 24),
      Title: "School Fee3",
      Amount: 654,
    },
    {
      id: "4",
      date: new Date(2023, 6, 24),
      Title: "School Fee4",
      Amount: 540,
    },
  ];

  return (
    <div>
      <h2>Let's Get Started</h2>
         <Expense item={expense}/>
    </div>
  );
}

export default App;
